import styles from "./Nav.module.css"
import {Link} from "react-router-dom"

function Nav ({items}){

    return (
        <ul className={styles.navList}>
            {
                items.map((item, key)=>{
                    return <>
                    <Link key={key} className={styles.navItem} >{item}</Link>
                    </>
                    return <li key={key} className={styles.navItem}>{item}</li>
                    //return <li key={key} className={styles.navItem}>{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
